import React from 'react';

function App() {
  return (
    <div>
      <h1> ToDo List </h1>
      <div className='INB'>
        <input
          type='text'
          id='input'
          placeholder='Type Your Name'
          // onChange={inputEvent}
          // value={name}
        />
        <button>+</button>
      </div>
      <ol>
        <li>Ritam</li>
      </ol>
    </div>
  );
}

export default App;
